// For example, if the serialized input is a `[2 x 3]` matrix representing two
// original `SparseTensor` objects:
//
//	index = [ 0]
//	        [10]
//	        [20]
//	values = [1, 2, 3]
//	shape = [50]
//
// and
//
//	index = [ 2]
//	        [10]
//	values = [4, 5]
//	shape = [30]
//
