//
//	index = [0  0]
//	        [0 10]
//	        [0 20]
//	        [1  2]
//	        [1 10]
//	values = [1, 2, 3, 4, 5]
//	shape = [2 50]
//
// Arguments:
//
//	serialized_sparse: The serialized `SparseTensor` objects. The last dimension
