// Partitions `data` into `num_partitions` tensors using indices from `partitions`.
//
// For each index tuple `js` of size `partitions.ndim`, the slice `data[js, ...]`
// becomes part of `outputs[partitions[js]]`.  The slices with `partitions[js] = i`
// are placed in `outputs[i]` in lexicographic order of `js`, and the first
// dimension of `outputs[i]` is the number of entries in `partitions` equal to `i`.
// In detail,
//
// ```python
//
//	outputs[i].shape = [sum(partitions == i)] + data.shape[partitions.ndim:]
//
//	outputs[i] = pack([data[js, ...] for js if partitions[js] == i])
//
// ```
//
// `data.shape` must start with `partitions.shape`.
//
// For example:
//
// ```python
//
//	# Scalar partitions.
//	partitions = 1
//	num_partitions = 2
//	data = [10, 20]
//	outputs[0] = []  # Empty with shape [0, 2]
//	outputs[1] = [[10, 20]]
//
//	# Vector partitions.
//	partitions = [0, 0, 1, 1, 0]
//	num_partitions = 2
//	data = [10, 20, 30, 40, 50]
//	outputs[0] = [10, 20, 50]
//	outputs[1] = [30, 40]
//
// ```
//
// See `dynamic_stitch` for an example on how to merge partitions back.
//
// <div style="width:70%; margin:auto; margin-bottom:10px; margin-top:20px;">
// <img style="width:100%" src="https://www.tensorflow.org/images/DynamicPartition.png" alt>
// </div>
//
// Raises:
//   - `InvalidArgumentError` in following cases:
//   - If partitions is not in range `[0, num_partiions)`
//   - If `partitions.shape` does not match prefix of `data.shape` argument.
//
// Arguments:
//
//	partitions: Any shape.  Indices in the range `[0, num_partitions)`.
//	num_partitions: The number of partitions to output.
func DynamicPartition(scope *Scope, data tf.Output, partitions tf.Output, num_partitions int64) (outputs []tf.Output) {
	if scope.Err() != nil {
		return
	}
	attrs := map[string]interface{}{"num_partitions": num_partitions}
	opspec := tf.OpSpec{
		Type: "DynamicPartition",
		Input: []tf.Input{
			data, partitions,
		},
		Attrs: attrs,
	}
	op := scope.AddOperation(opspec)
	if scope.Err() != nil {
		return
	}
	var idx int
	var err error
	if outputs, idx, err = makeOutputList(op, idx, "outputs"); err != nil {
		scope.UpdateErr("DynamicPartition", err)
		return
	}
	return outputs
}

// Interleave the values from the `data` tensors into a single tensor.
//
// # Builds a merged tensor such that
//
// ```python
//
//	merged[indices[m][i, ..., j], ...] = data[m][i, ..., j, ...]
//
// ```
//
// For example, if each `indices[m]` is scalar or vector, we have
//
// ```python
//
//	# Scalar indices:
//	merged[indices[m], ...] = data[m][...]
//
//	# Vector indices:
//	merged[indices[m][i], ...] = data[m][i, ...]
//
// ```
//
// Each `data[i].shape` must start with the corresponding `indices[i].shape`,
// and the rest of `data[i].shape` must be constant w.r.t. `i`.  That is, we
// must have `data[i].shape = indices[i].shape + constant`.  In terms of this
// `constant`, the output shape is
//
//	merged.shape = [max(indices) + 1] + constant
//
// Values are merged in order, so if an index appears in both `indices[m][i]` and
// `indices[n][j]` for `(m,i) < (n,j)` the slice `data[n][j]` will appear in the
// merged result. If you do not need this guarantee, ParallelDynamicStitch might
// perform better on some devices.
//
// For example:
//
// ```python
//
//	indices[0] = 6
//	indices[1] = [4, 1]
//	indices[2] = [[5, 2], [0, 3]]
//	data[0] = [61, 62]
//	data[1] = [[41, 42], [11, 12]]
//	data[2] = [[[51, 52], [21, 22]], [[1, 2], [31, 32]]]
//	merged = [[1, 2], [11, 12], [21, 22], [31, 32], [41, 42],
//	          [51, 52], [61, 62]]
//
// ```
//
// This method can be used to merge partitions created by `dynamic_partition`
// as illustrated on the following example:
//
// ```python
//
//	# Apply function (increments x_i) on elements for which a certain condition
//	# apply (x_i != -1 in this example).
//	x=tf.constant([0.1, -1., 5.2, 4.3, -1., 7.4])
//	condition_mask=tf.not_equal(x,tf.constant(-1.))
//	partitioned_data = tf.dynamic_partition(
//	    x, tf.cast(condition_mask, tf.int32) , 2)
//	partitioned_data[1] = partitioned_data[1] + 1.0
//	condition_indices = tf.dynamic_partition(
//	    tf.range(tf.shape(x)[0]), tf.cast(condition_mask, tf.int32) , 2)
//	x = tf.dynamic_stitch(condition_indices, partitioned_data)
//	# Here x=[1.1, -1., 6.2, 5.3, -1, 8.4], the -1. values remain
//	# unchanged.
//
// ```
//
// <div style="width:70%; margin:auto; margin-bottom:10px; margin-top:20px;">
// <img style="width:100%" src="https://www.tensorflow.org/images/DynamicStitch.png" alt>
// </div>
func DynamicStitch(scope *Scope, indices []tf.Output, data []tf.Output) (merged tf.Output) {
	if scope.Err() != nil {
		return
	}
	opspec := tf.OpSpec{
		Type: "DynamicStitch",
		Input: []tf.Input{
			tf.OutputList(indices), tf.OutputList(data),
		},
	}
	op := scope.AddOperation(opspec)
	return op.Output(0)
}

