//
// This is an N-length vector.
//
//	hypothesis_shape: The shape of the hypothesis list SparseTensor.
//
// This is an R-length vector.
//
//	truth_indices: The indices of the truth list SparseTensor.
//
// This is an M x R int64 matrix.
//
